export default (function(a,b,c,d,e){return {data:{SQd31TqjBZ:{data:{id:2653,attributes:{imdbId:"tt0117951",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzA5Zjc3ZTMtMmU5YS00YTMwLWI4MWUtYTU0YTVmNjVmODZhXkEyXkFqcGdeQXVyNjU0OTQ0OTY@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"8.1\u002F10"},{Source:"Rotten Tomatoes",Value:"91%"},{Source:"Metacritic",Value:"83\u002F100"}],item_lang:{data:{id:3316,attributes:{title:c,plot:"A wild, freeform, Rabelaisian trip through the darkest recesses of Edinburgh low-life, focusing on Mark Renton and his attempt to give up his heroin habit, and how the latter affects his relationship with family and friends: Sean Connery wannabe Sick Boy, dimbulb Spud, psycho Begbie, 14-year-old girlfriend Diane, and clean-cut athlete Tommy, who's never touched drugs but can't help being curious about them...",slug:"trainspotting"}}},books:{data:[{id:12692,attributes:{title:c,description:"Die volle Ladung Leben - ein Klassiker der Underground-Literatur Mietskasernen, Arbeitslosigkeit, miese Pubs, viel Alkohol und jede Menge Drogen: das ist der Alltag in Leith, einem heruntergekommenen Vorort von Edinburgh. Das ist auch der Alltag von Renton, Spud, Begbie, Sick Boy und Dianne, einer Clique von jugendlichen Außenseitern, in deren Leben sich fast alles um Drogen dreht. Wer kein Junkie ist, wird bald einer werden oder war einer oder wird bald wieder einer sein. Neben Stuff, Rausch, Entzug, Sex, Frust und Gewalt gibt es aber auch noch die Musik. Und wenn diese Anti-Helden schon alle den Blues haben, so doch zumindest mit 160 beats per minute.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Xe9tAAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2013-10-14",publisher:"Heyne Verlag",subtitle:"Roman"}},{id:12693,attributes:{title:c,description:"Trainspotting is the novel that first launched Irvine Welsh's spectacular career—an authentic, unrelenting, and strangely exhilarating episodic group portrait of blasted lives. It accomplished for its own time and place what Hubert Selby, Jr.'s Last Exit to Brooklyn did for his. Rents, Sick Boy, Mother Superior, Swanney, Spuds, and Seeker are as unforgettable a clutch of junkies, rude boys, and psychos as readers will ever encounter. Trainspotting was made into the 1996 cult film starring Ewan MacGregor and directed by Danny Boyle (Shallow Grave).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Z-mk_S9bkuEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"1996-06-17",publisher:e,subtitle:b}},{id:12694,attributes:{title:c,description:"De inmediato celebrada por los críticos más estrictos, pero leída también por aquellos que raramente se acercan a los libros, esta novela se convirtió en uno de los acontecimientos literarios y también extraliterarios de los últimos años. Fue rápidamente",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jYMVSgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2002-01-01",publisher:"Anagrama",subtitle:b}},{id:12695,attributes:{title:"TRAINSPOTTING",description:"If trains and railway modelling are your passion or you just love quality scale modelling you can’t miss this book with the usual AK’s quality display plus Marklin’s input. A handbook that will possibly become a cult book for scale railway modelers in the next years. A new approach for an instructional book and the for the way techniques are displayed to beginners and advanced modellers. The book is structured in three main blocks. The first part contains the different techniques and materials we have at our disposal in order to be able to represent as many different effects as it is necessary. The second block walks us through a greatly visual and detailed description of the different processes and materials involved in representing these effects on different types of locomotives and wagons. A variety of techniques and work carried out by some of the best European and American modellers. On the third section we will see how to weather railway buildings and rail station structures and their elements. This goes together with a chapter full of real reference pictures of trains from around the world that will really delight the reader and push many to start with the hobby.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VVrWCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"1000-01-01",publisher:b,subtitle:b}},{id:12696,attributes:{title:"T2 Trainspotting (Movie Tie-in)",description:"Now a Major Motion Picture Here is the Trainspotting crew ten years further down the line: still scheming, still scamming, still fighting for the first-class seats as the train careens at high velocity with derailment looming around the next corner. In this world, even the cons get conned. Sick Boy and Renton jockey for top dog, and out-of-jail and in-for-revenge Begbie is on the loose. But it’s drug-addled Spud who may be creating the most trouble.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=aJsADgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2017-03-07",publisher:e,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940904956}}("Irvine Welsh","","Trainspotting",null,"W. W. Norton & Company"))